import { useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";
import { Navbar } from "../Layout/Navbar";
import { Map } from "../Layout/Caroucel";
import Button from "react-bootstrap/esm/Button";

import { getPosts } from "./postBehavior";
export const Dashboard = () => {
  const [Post, setPost] = useState();
  let nav = useNavigate();

  const getallPost = async () => {
    try {
      const GetallPostzx = await getPosts(localStorage.getItem("token"));
      if (GetallPostzx.success) {
        setPost(GetallPostzx.Post_of_User);
      }
    } catch (error) {
      console.log(error);
    }
  };
  const arrayOfObjects = [{ coffee: "Americano", size: "Medium" }];
  useEffect(() => {
    if (localStorage.getItem("token") === null) {
      return nav("/login");
    }
    getallPost();
    console.log("Arraobj1", arrayOfObjects);
    console.log("Arraobj2", Post);
  });
  return (
    <>
      <Navbar></Navbar>
      <Map></Map>
      {arrayOfObjects &&
        arrayOfObjects.map(({ size, coffee }) => (
          <p key={coffee}>
            Coffee type {coffee} in a {size} size.
          </p>
        ))}
      {Post &&
        Post.map(({ title, _id }) => (
          <p key={coffee}>
            Coffee type {coffee} in a {size} size.
          </p>
        ))}
      <div className="managePost">
        <span className="managePost-title">
          <Button
            type="button"
            className="btn btn-primary"
            data-bs-toggle="modal"
            data-bs-target="#staticBackdrop"
          >
            Add post
          </Button>
        </span>
        <div
          className="modal fade"
          id="staticBackdrop"
          data-bs-backdrop="static"
          data-bs-keyboard="false"
          // tabindex={-1}
          aria-labelledby="staticBackdropLabel"
          aria-hidden="true"
        >
          <div className="modal-dialog">
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title" id="staticBackdropLabel">
                  Modal title
                </h5>
                <button
                  type="button"
                  className="btn-close"
                  data-bs-dismiss="modal"
                  aria-label="Close"
                ></button>
              </div>
              <div className="modal-body">...</div>
              <div className="modal-footer">
                <button
                  type="button"
                  className="btn btn-secondary"
                  data-bs-dismiss="modal"
                >
                  Post
                </button>
                <button type="button" className="btn btn-primary">
                  Understood
                </button>
              </div>
            </div>
          </div>
        </div>
        <div className="managePost-body">
          <ul className="body-Listitem">
            {Post &&
              Post.map((name, email) => {
                <li className="body-item">{name}</li>;
              })}
            <li className="body-item">a</li>;
          </ul>
        </div>
      </div>
    </>
  );
};
